import React from 'react';
import GraphVisualizer from './GraphVisualizer';

function GraphPage({ navigateHome, fullPath, processedMovies }) {
    return (
        <div>
            <h1>Interactive Movie Graph</h1>
            <button onClick={navigateHome}>Back to Movie Deck</button>
            <GraphVisualizer fullPath={fullPath} processedMovies={processedMovies} /> {/* Pass movies array */}
        </div>
    );
}

export default GraphPage;
